import React from 'react';
import logo from "./assets/logo.png";
import "./Header.css";
import { Link } from "react-router-dom";

function Header() {
    return (
        <nav className="header">
            <Link><img
                className="header-logo"
                src={logo}>
            </img></Link>


        </nav>
    );
}

export default Header;
